            font-family: monospace;
            font-size: 16px;
        }

        .error {
            color: red;
        }

        .eos {
            color: gray;
        }

        .level-bar {
            color: black;
        }
    </style>

    <body>
        <script>
            function updateState() {
                try {
                    let request = new XMLHttpRequest();
                    request.addEventListener("load", updateDiv);
                    request.open("GET", "/state.json");
                    request.send();
                } catch (error) {
                    console.log("Failed to fetch state: " + error);
                }
            }

            function updateDiv() {
                try {
                    // Decode object and get content div
                    let object = JSON.parse(this.responseText);
                    let div = document.getElementById("contentDiv");

                    // Match type and call corresponding display function
                    if (object.hasOwnProperty("Error")) updateDivError(div, object["Error"]);
                    else if (object.hasOwnProperty("Eos")) updateDivEos(div, object["Eos"]);
                    else if (object.hasOwnProperty("Levels")) updateDivLevel(div, object["Levels"]);
                    else throw "Invalid state object ‽";
                } catch(error) {
                    console.log("Failed to decode/display state: " + error);
                }
            }

            function updateDivError(div, error) {
                div.innerHTML = "<p class=\"error\">Some error occurred: " + error + "</p>";
            }

            function updateDivEos(div, eos) {
                div.innerHTML = "<p class=\"eos\">End of service (" + eos + ")</p>";
            }

            function updateDivLevel(div, levels) {
                // A helper function to create an ASCII bar
                function createAsciiBar(level) {
                    const multiplicator = 0.25;

                    let bar = "";
                    for (var i = 0.0; i < level * multiplicator; i++) bar += "=";
                    return bar;
                }

                // Display bars
                let level = levels[levels.length - 1];
                div.innerHTML = "<p class=\"level-bar\">Level:</p>";
                div.innerHTML += "<p class=\"level-bar\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Rms: " + createAsciiBar(level["rms"]) + "</p>";
                div.innerHTML += "<p class=\"level-bar\">&nbsp;&nbsp;&nbsp;&nbsp;Peak: " + createAsciiBar(level["peak"]) + "</p>";
                div.innerHTML += "<p class=\"level-bar\">Whatever: " + createAsciiBar(level["whatever"]) + "</p>";
            }

            console.log("Setting event...");
            window.setInterval(updateState, 500);
        </script>

        <div id="contentDiv"></div>
    </body>
</html>
